import React from "react";
import "./App.css";

const rates = fetch(
  "https://openexchangerates.org/api/latest.json?app_id=37ce05177037491283b06fe29e31e8f3"
)
  .then((res) => res.json()) //response type
  .then((data) => {
    return data;
  });

function App() {
  return <div className="App">{rates}</div>;
}

export default App;
